--  DDL for Trigger UPDATING_QTY_ACCESORIES
--------------------------------------------------------

  CREATE OR REPLACE NONEDITIONABLE TRIGGER "SYSTEM"."UPDATING_QTY_ACCESORIES" AFTER INSERT ON BILL_DETAILS
FOR EACH ROW

BEGIN
    UPDATE ACCESORIES SET ACCESORIES.UNITS_AVAILABLE = UNITS_AVAILABLE - :new.QTY_ACCESORIES
    WHERE ID_ACCESORY = :new.ID_ACCESORIES;
END;
/
ALTER TRIGGER "SYSTEM"."UPDATING_QTY_ACCESORIES" ENABLE;
