--  DDL for Procedure HISTORY_VEHICLE
--------------------------------------------------------
set define off;

  CREATE OR REPLACE NONEDITIONABLE PROCEDURE "SYSTEM"."HISTORY_VEHICLE" (V_NUMBER NUMBER, p_resultset IN OUT SYS_REFCURSOR) AS
BEGIN
    OPEN p_resultset FOR
    SELECT VEHICLES.ID_VEHICLE, VEHICLES.VEHICLE_STATUS, BILLS.DATEOFBILL, BILL_DETAILS.VEHICLE_STATUS FROM VEHICLES INNER JOIN BILL_DETAILS ON VEHICLES.ID_VEHICLE = BILL_DETAILS.ID_VEHICLE INNER JOIN BILLS ON BILL_DETAILS.ID_BILLS = BILLS.ID
    WHERE VEHICLES.ID_VEHICLE = V_NUMBER;
END;

/
