--  DDL for Function BILL_SEARCHING
--------------------------------------------------------

  CREATE OR REPLACE NONEDITIONABLE FUNCTION "SYSTEM"."BILL_SEARCHING" (idVehicle number) RETURN BILL_SEARCH IS
v2 BILL_SEARCH;
BEGIN
SELECT ID_BILL,ID_SALES_PERSON,SALES_PERSON_NAME,ID_CUSTOMER,NAME_CUSTOMER,ID_VEHICLE,VEHICLE_STATUS,
ID_MANUFACTER,MANUFACTERNAME,ID_ACCESORIES,ACCESORY_DESCRIPTION,DATEOFBILL,TOTALCOST
INTO v2 FROM IMPRESION_BILLS WHERE ID_BILL = idVehicle;
END;

